import React from "react";

const Navigation = () => {
  return (
    <div className="navbar">
      <div className="logo">
        <a href="/">
          <img src="../images/logo2.png" alt="" />
        </a>
      </div>
      <div className="links">
        <p className=" hover-underline-animation">Sign In</p>
        <p className=" hover-underline-animation">Log In</p>
      </div>
    </div>
  );
};

export default Navigation;
